        MSLAddOMEGA_X(builder, self.OMEGA_X)
        MSLAddOMEGA_Y(builder, self.OMEGA_Y)
        MSLAddOMEGA_Z(builder, self.OMEGA_Z)
        MSLAddMASS(builder, self.MASS)
        MSLAddMASS_INITIAL(builder, self.MASS_INITIAL)
        MSLAddTARGET_POSITION_X(builder, self.TARGET_POSITION_X)
        MSLAddTARGET_POSITION_Y(builder, self.TARGET_POSITION_Y)
        MSLAddTARGET_POSITION_Z(builder, self.TARGET_POSITION_Z)
        MSLAddTARGET_VELOCITY_X(builder, self.TARGET_VELOCITY_X)
