        MSLAddTARGET_VELOCITY_Z(builder, self.TARGET_VELOCITY_Z)
        MSLAddMISS_DISTANCE(builder, self.MISS_DISTANCE)
        if self.SEEKER is not None:
            MSLAddSEEKER(builder, SEEKER)
        if self.MOTOR is not None:
            MSLAddMOTOR(builder, MOTOR)
        if self.GUIDANCE_CMD is not None:
            MSLAddGUIDANCE_CMD(builder, GUIDANCE_CMD)
        MSLAddPHASE(builder, self.PHASE)
